const aStyle = {
  listStyle: "none",
  textDecoration: "none",
};
const ulStyle = {
  ...aStyle,
  margin: 0,
  padding: 0,
  textAlign: "right",
};
const liStyle = {
  ...aStyle,
  display: "inline-block",
  padding: "10px",
  textBorderleft: "none",
};

export default {
  liStyle,
  ulStyle,
  aStyle,
};
